import React from "react";


const useStyles = makeStyles((theme) => ({
  contactContainer: {
      background: "#233",
      height: "100vh",
  },
  heading: {
      color: "tomato",
      textAlign: "center",
      textTransform: "uppercase",
      marginBottom: "1rem",
  },
  form: {
      top: "50%",
      left: "50%",
      transform: "translate(-50%, -50%)",
      position: "absolute",
  },
  input: {
      color: "#fff",
  },
  button: {
      marginTop: "1rem",
      color: "tomato",
      borderColor: "tan",
  },
  field: {
      margin: "1rem 0rem",
  },
}));

const InputField = withStyles({
  root: {
      "& label.Mui-focused": {
          color: "tomato",
      },
      "& label": {
          color: "tan",
      },
      "& .MuiOutlinedInput-root": {
          "& fieldset": {
              borderColor: "tan",
          },
          "&:hover fieldset": {
              borderColor: "tan",
          },
          "&.Mui-focused fieldset": {
              color: "#fff",
              borderColor: "tan",
          },
      },
  },
})(TextField);


function Contact() {
  const classes = useStyles();

  return (
    <section
      className="paralax-mf footer-paralax bg-image sect-mt4 route"
    >


      <footer>
        <div className="container">
          <div className="row">
            <div className="col-sm-12">
              <div className="copyright-box">
              </div>
            </div>
          </div>
        </div>
      </footer>
    </section>
  );
}

export default Contact;
